import React, { Component } from 'react';

class Ehsan extends Component { 
    constructor(props){
        super(props);
        this.reset();
    }
    reset(){
        this.state ={
            inputValue : ''
        }
    }
    render(){
        return (
            <div>
            <header className='bg-info'>
                <div className='text-light'>ToDo</div>
           </header>
           <input type="text" value={this.reset.state.inputValue} id="" />
</div>
        );

    }
}

export default Ehsan;
